import React from "react";
import update from "../../images/update.png"

 const CardUi=propss=>{
     return(
         <>
            <div className="card text-center">
                <div className="overflow">
                    <img src={update} alt="ImageUpdate"/>
                </div>
            </div>


         </>

     );

}
export default CardUi
